import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import api from './service/api';


class Main extends React.Component{
    constructor(props){
      super(props);
      this.state = {};
    }

    componentDidMount(){
      this.loadData();
    }

    loadData = async () => {
      try{
        let result = await api.get('/api/v2/pages/?type=posts.PostPage&fields=post_image');
        this.setState({
          list: result.data
        });
      }catch(e){
        console.log(e)
      }
    }

    render(){
      var { list } = this.state;
      if(list)
        console.log(this.state.list.items[0].post_image)
      return(
        <div >
          <h1>OIIIIIIIIIAFD</h1>
          {list &&
            <div id='wrapper'> 
              <div className='image-container'>
                <img 
                  src = {`http://localhost:8000${list.items[0].post_image.url}`}
                  width = '100%'
                  height =  {list.items[0].post_image.height}
                />
              </div>
              <ul>
                {list && 
                list.items.map(item => (
                  <li
                    key = {item.id}
                  >
                    <p>{item.title}</p>
                    <img 
                      src = {`http://localhost:8000${item.post_image.url}`}
                      width = {item.post_image.width}
                      height = {item.post_image.height}
                    />
                  </li>
                ))
                }
              </ul>
            </div>   
           }
        </div>
      )
    }
}

ReactDOM.render(
  <Main />,
  document.getElementById('root')
);
